    margin: 100px 40px 40px 40px;
    display: grid;
    grid-template-columns: 1fr 1fr;
    gap: 20px;
}
.backhome-inner{
    border-bottom: 3px dotted $shade2;
    text-decoration: none;
}
.backhome-inner:hover{
    color: $green;
}


@media screen and (max-width: $mobile) {
    .footer-name{
        display: none;
    }
    .footer-credit{
        display: none;
    }
    .footer-grid{
        padding: 20px 20px 25px 20px;
    }

    .backhome-outer{
        margin: 80px 20px 20px 20px;
    }
}
@media screen and (max-width: $tablet) {

}

sources.styles/style.scss:
//components
@import 'components/breakpoints', 'components/colors', 'components/fonts';
//index
@import 'pages/home', 'pages/projects', 'components/footer.scss', 'components/header.scss';

*  { 
    margin: 0; 
    padding: 0; 
}
body {
    background: $background;
}
a{
    color: $black;
}
.animation-transition{
  transition: .2s ease-in-out;
}

.temporary{
    font-family: 'Mabry';
    font-size: 30px;
    margin: 30px;
    line-height: 47px;
}
.blinking {
    animation: blink-animation 1s steps(2, start) infinite;
    -webkit-animation: blink-animation 1s steps(2, start) infinite;
    color: red;
  }
  @keyframes blink-animation {
    to {
      visibility: hidden;
    }
  }
  @-webkit-keyframes blink-animation {
    to {
      visibility: hidden;
    }
  }
